import React from 'react';
import './Section.scss';
import { Image, Container, Row, Col } from 'react-bootstrap';

interface Props {
    title: string;
    content: string;
    colour: string;
}

export const Section = (props: Props) => (
    <div className="Section">
        <Container>
            <Row>
                <Col>
                    <h3>{props.title}</h3>
                </Col>
                <Col>
                    <p>{props.content}</p>
                </Col>
            </Row>
        </Container>
    </div>
);
